export const weatherIcons = [
    {
        "label" : "Clouds",
        "icon" : "fas fa-cloud"
    },
    {
        "label" : "Rain",
        "icon" : "fas fa-cloud-rain"
    },
    {
        "label" : "Clear",
        "icon" : "fas fa-sun"
    }
]

export const temperatureIcon = "fas fa-thermometer-three-quarters"
export const windIcon ="fas fa-wind"
